import React from 'react'
import Client from './Client'
import beyonce from 'img/clients/beyonce.png'

const Clients = () => {
  return (
    <div className='content' id='clients'>
        <div className="clients-row">
            <Client img={beyonce} />
        </div>
    </div>
  )
}

export default Clients
